 import Index from "views/Index.js";
import Profile from "views/examples/Profile.js";
import Maps from "views/examples/Maps.js";
import Tables from "views/examples/Tables.js";
//import Icons from "views/examples/Icons.js";
import Fichaje from "views/examples/Fichaje.js";
var routes = [
  {
    path: "/ficahje",
    name: "Fichaje",
    icon: "bi bi-calendar2-week text-primary",
    component: <Fichaje />,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Vacaciones",
    icon: "bi bi-calendar2-week text-primary",
    component: <Tables />,
    layout: "/admin",
  },

  {
    path: "/maps",
    name: "Tareas",
    icon: "ni ni-collection text-orange",
    component: <Maps />,
    layout: "/admin",
  },
  /*{
    path: "/icons",
    name: "Equipo",
    icon: "ni ni-ungroup text-green",
    component: <Icons />,
    layout: "/admin",
  },*/
  {
    path: "/index",
    name: "Estadisticas",
    icon: "ni ni-chart-bar-32 text-red",
    component: <Index />,
    layout: "/admin",
  },
  {
    path: "/user-profile",
    name: "Perfil",
    icon: "ni ni-single-02 text-purple",
    component: <Profile />,
    layout: "/admin",
  },
];
export default routes;
